import Head from 'next/head'
import Layout, { siteTitle } from '../components/layout'
import Form from '../components/form'

const NOTION_BLOG_ID = '3672c8010da9404aa143b20ed50ab348'

export const getAllPosts = async () => {
	return await fetch(
    `https://notion-api.splitbee.io/v1/table/${NOTION_BLOG_ID}`
  ).then((res) => res.json());
}

export async function getStaticProps() {
  const allPostsData = await getAllPosts()
  return {
    props: {
      allPostsData
    }
  }
}

export default function Home({ allPostsData }) {
  return (
    <Layout page='home'>
      <Head>
        <title>{siteTitle}</title>
      </Head>
      <section>
        <p><b className='font-medium'>currently product data at Music & Podcasts.</b> fellow at <a className='hover:bg-yellow-300' href='https://goldhouse.org'>gold house</a>. previously <a className='hover:bg-black hover:text-white' href='https://www.bird.co'>bird</a> and <a className='hover:bg-blue-500 hover:text-white' href='https://jmi.com'>jmi equity</a>. retired D1 swimmer at Penn. lover of athletics, films, delightful products, and oatmeal.</p>
        <br></br>
        <p>
          <b className='font-medium'>i'm working on a breaking into data science analytics course.</b> sign up below to my email list to get updates and early access on all new content.
        </p>
        <div>
          <Form/>
        </div>
        <br></br>
        <p>
          questions? reach me at me@mikewen.co
        </p>
        <br></br>
        <p className='mt-24 mb-8'>~</p>
        <div className='flex flex-row'>
          <a className='flex-1 underline text-gray-400 hover:text-black' href=''>insta</a>
          <a className='flex-1 underline text-gray-400 hover:text-black' href=''>twitter</a>
          <a className='flex-1 underline text-gray-400 hover:text-black' href=''>github</a>
          <a className='flex-1 underline text-gray-400 hover:text-black' href=''>linkedin</a>
        </div>
      </section>
    </Layout>
  )
}
